import React from 'react';
import { useAuth } from '../../context/AuthContext';

const AdminDashboard = () => {
  const { currentUser } = useAuth();
  
  return (
    <div style={{ padding: '20px' }}>
      <h1>Admin Dashboard</h1>
      <p>Welcome, {currentUser?.name || 'Administrator'}!</p>
      
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', 
        gap: '20px',
        marginTop: '30px'
      }}>
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Total Members</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>45</p>
        </div>
        
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Pending Complaints</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>4</p>
        </div>
        
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Total Expenses</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>₹1,25,000</p>
        </div>
        
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Monthly Collection</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>₹4,50,000</p>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
